行訓練中の航空自衛隊のＦ15戦闘機が、油圧系統のトラブルのため千歳基地に緊急着陸しました。

　航空自衛隊によりますと、25日午後０時50分ごろ、飛行訓練中のＦ15戦闘機が、油圧系統のトラブルのため千歳基地に緊急着陸しました。
